import React from 'react';
import { Text, View } from 'react-native';
import AppText from '../../components/text/AppText';
import colors from '../../styles/colors';
import { styles } from '../../styles/styles';

const ModeOfPaymentsScreen = () => {
    const { bg_light, container, row_center_x } = styles
    const { darkGrey } = colors

    return (
        <View style={container}>
            <View style={bg_light}>
                <View style={row_center_x}>
                    <AppText as="h5" bold color={darkGrey}>Bank Name:</AppText>
                    <AppText>bankName</AppText>
                </View>
            </View>
        </View>
    );
}

export default ModeOfPaymentsScreen;
